const App = () =>{

  const categories = [
    {
      id: 1,
      title: 'Hats',
    },
    {
      id: 2,
      title: 'Jackets',
    },
    {
      id: 3,
      title: 'Sneakers',
    },
    {
      id: 4,
      title: 'Womens',
    },
    {
      id: 5,
      title: 'Mens',
    },
  ];
  return (
   <div className=" categories-com=ntainer">
    <div className="category-container">
      <div className="category -body-container">
        <h2>Why Puppy Culture?</h2>
        <img src="logo"/>
        <p>LEARN MORE</p>
      </div>

      <div className="category-container">
      {/* <img/> */}
      <div className="category -body-container">
        <h2>Shop Our Products!</h2>
        <p>SHOP</p>
      </div>
      </div>

      <div className="category-container">
      {/* <img/> */}
      <div className="category -body-container">
        <h2>What Should I Buy?</h2>
        <p>LEARN MORE</p>
      </div>
      </div>

      <div className="category-container">
      {/* <img/> */}
      <div className="category -body-container">
        <h2>Madcap University</h2>
        <p>LEARN MORE</p>
      </div>
      </div>

    </div>
    <footer>
      <h2> Quick links</h2>
      <p> My Account Support Portal / FAQs Keep Informed Contact Us Policies / Data Requests </p>
    </footer>
    <footer>
      <p> © 2023, PUPPY CULTURE . Return/Refund policy . Privacy policy . Terms of service . Shipping policy </p>
    </footer>
    <footer>
      <h2> india (INR₹)</h2>
    </footer>
   </div>
  );
}

export default App;
